import pic1 from "../images/samplepic.jpg";
import pic2 from "../images/dancer.jpg";

var MemberInfo = {
    "info": [
        {
            "image": pic1,
            "role": "creative director",
            "name": "Carrie Bradshaw"
        },

        {
            "image": pic2,
            "role": "marketing assistant",
            "name": "Samantha Jones"
        },
    ]
}

export {MemberInfo}
